(3, 'PEKOM CISCO COMMUNITY SERVICE', '2013-05-19', '8AM', 'Rumah Baitulhidayah, Puchong', 'Persatuan Komputer UM (PEKOM)', 'Activities:- installation wifi repeater, printer, laptop and other devices - Clean up trash inside and outside the house and drain  - Teach the kids how to use microsoft Word,Excel,Powerpoint etc', 'Omar Mokhtar Ozie', NULL),
